import './App.css';

function App() {
	return (
		<div className="top-cont">
			<header>
			<div class="home-button-cont">

				<a class="home-button">
					WebShop
				</a>
			</div>

				<nav>
					<ul class="navigation" id="nav">
						<li>
							<a class="nav-button">Need help?</a>
						</li>
					</ul>
				</nav>

			</header>


		</div>
	);
}

export default App;
